import React, { useState } from "react";
import Login from "./Login";
import Inicio from "./components/inicio.jsx";

function App() {
  const [autenticado, setAutenticado] = useState(false);

  return (
    <div>
      {autenticado ? (
        <Inicio />
      ) : (
        <Login setAutenticado={setAutenticado} />
      )}
    </div>
  );
}

export default App;
